[CzechCasting] Denisa (2173 / 09.12.2013)

Swear you will keep everything that is about to happen for yourself!!! Nobody can find this out, at no costs! It would cause Denisa a hell of trouble! Her boyfriend would probably kill her. Well, let's start from the beginning. Denisa is a Czech amateur with black hair, she smiles a lot, but she's rather nervous. She says she is shy and it is also her first casting ever. She would like to photograph something with a girl, but she's afraid. Her boyfriend knows nothing and he definitely wouldn't agree. Denisa was really nervous, trembling all the time, we didn't even think of filming anything piquant. But what happened in the shower, after the end of the official presentation, shocked us!!! Do you want to see footage outside the official backstage? What are you waiting for? Check out this video, but don't tell anybody, ok? 

